B.jl=new A.bC(B.aS,"A solid choice for any duellist, Hades is capable of accelerating unexpectedly fast and outfitted with a wide variety of weapons.\n\nIt carries enough mounted equipment to compensate for its relatively light armor, and when manned by an experienced crew, Hades can be a complex and overwhelming offensive force.",11,"hades")
B.aN=new A.dL(11,"set4")
B.jm=new A.bC(B.aN,"Sawtooth is fast, brutal, and crewed by absolute maniacs.\n\nBuilt on the frame of a small luxury coupe, it's exceptionally nimble and isn't concerned with tire damage.\n\nAn unpredictable clsoe-quarters nightmare, Sawtooth rams into other cars and jabs its Bonesaw right into the open wound.",22,"sawtooth")
B.jn=new A.bC(B.aN,"Kodiak's concealed weapons remain a mystery until an opponent overcommits and Kodiak lets loose.\n\nThe thick plating, wheel protection, and smoke emitter make the lumbering Kodiak extremely difficult to destroy even before considering the massive machine gun, melee weapons, and whatever is hiding beneath the plating.",18,"kodiak")
B.aO=new A.dL(9,"set2")
B.jo=new A.bC(B.aO,"Outfitted with an array of high-energy laser weapons, improved handling, and a reactive defense system, Pure Energy prefers to snipe at foes from long range, rather than charging into the fender-to-fender combat.\n\nIt is nimble and fairly durable, but its lasers are easily destroyed by a persistent opponent.",20,"pureEnergy")
B.X=new A.dL(2,"core")
B.jp=new A.bC(B.X,"Superflash relies on an electromagnetic distortion field and smokescreens to minimize counterattacks while making long-range, precision attacks.\n\nIt can carry fewer weapons than most other vehicles because its thick skin keeps everything safe and functioning for much longer than usual, even under heavy fire.",30,"superflash")
B.jq=new A.bC(B.aN,"The Conestoga is very well equipped, but requires a talented crew due to the lack of driving aids and asymmetrical loadout.\n\nThe handling isn't great, but as long as the crew can keep control of the car, the Conestoga is dangerous from all angles and performs well in any duelling format.",7,"conestoga")
B.aR=new A.dL(10,"set3")
B.jr=new A.bC(B.aR,"The Aristocrat is almost regal in design, despite the fact that it is bristling with a wide array of weapons.\n\nIts light defensive setup means it won't last long in a firefight if it doesn't get the upper hand quickly.\n\nIt is a rolling hornet's nest, encircling opponents with fire mines before ripping them to shreds.",2,"aristocrat")
B.js=new A.bC(B.X,"Originally a light-duty military vehicle, the stout Goblin is well armored and plays the long game, chipping away at an opponent until the time is right to go in for the kill.\n\nDespite the added armor weight, Goblin is easy to control and is a good all-round rig for any duellist.",10,"goblin")
B.jt=new A.bC(B.aS,"The four tires hiding under Hydra's front fenders provide increased traction and improved airflow.\n\nThis, combined with the high-torque differential, make the car very easy to control at high speeds.\n\nThis control is necessary because Hydra is only moderately armed except for the giant cannon on the front, so positioning is crucial to keep opponents on the defensive.",14,"hydra")
B.ju=new A.bC(B.X,'Typhoon is the definition of a "glass cannon."\n\nIt packs a big enough punch to tear through even the most armored foe, but relies on fancy driving to keep it safe from attack.\n\nWith that in mind, it is well equipped to maintain control during extreme maneuvers, and only a handful of well-placed shots are needed to ensure a win.',31,"typhoon")
B.jv=new A.bC(B.X,"Built for ramming and loaded with concussion mines, the heavily-armored Warhawk is a formidable opponent.\n\nThe machine gun turret on the roof means there is no safe place for opponents to hide.\n\nIts weakest point is the rear armor, but the mine droppers make it exceptionally difficult for anyone to chase a Warhawk for too long.",32,"warhawk")
B.I3=new A.dL(0,"custom")
B.n_=new A.bC(B.I3,"",0,"custom")
B.jw=new A.bC(B.X,"The Dragon is a fire-breathing beast that has proven to be a reliable platform for many different styles of arena combat.\n\nIts bulky frame allows for a variety of structural upgrades, and the heavy forward-facing weapon mounts mean that anyone unfortunate enough to be caught in front of a Dragon is unlikely to survive for long.",8,"dragon")
B.jx=new A.bC(B.aS,"The Pillbug is a rolling fortress, heavily armored but only moderately armed.\n\nThe extra defense results in mediocre handling, but the heavy plating, wheel hubs, and shielded power plant keep it in the fight, rolling for much longer than most.\n\nThe crew has plenty of time to tear their opponents to bits.",19,"pillbug")
B.jy=new A.bC(B.X,"Hotshot is not particularly effective from long range, but once it closes the distance, it is equipped to slag even the toughest opponent.\n\nFavored by experienced duellists that aren't afraid to take a few knocks before incinerating everything in sight, combatants must either outgun a Hotshot...or outrun it.",13,"hotshot")
B.hl=new A.bC(B.aO,"Apollo is tough and very effective in a crowd, where its fire weapons and the crew's grenades can wreak the most havoc.\n\nThe long wheelbase means it isn't the easiest car to drive, so most Apollo drivers cruise around the perimeter of the arena until there is an ideal opportunity to dive into the mix.",1,"apollo")
B.jz=new A.bC(B.aR,"The low-slung Avalanche is essentially a high-speed tank with a weapon loadout designed to maximize tire damage.\n\nHeavy armor, tire protection, and a roll bar help the crew shrug off most attacks as they patiently wait to bash through any opponents left limping around the arena.",3,"avalanche")
B.jA=new A.bC(B.aR,"Preferred by maniacs and daredevils, Brimstone is a scrapyard beast that pollutes the arena with oil slicks.\n\nDespite its ramshackle appearance, this raucous car is tough and can deal huge damage.\n\nThe unprotected tires seem to be an obvious weak spot, but good luck getting anywhere near them.",5,"brimstone")
B.jB=new A.bC(B.X,"Butcher is a savage monster sitting atop a simple tractor, deadly and durable.\n\nIt is a vehicle for bombastic crew members that revel in total chaos.\n\nThe cabover design leaves the front of the vehicle somewhat exposed, but every other angle promises a grim death for opponents.",6,"butcher")
B.jC=new A.bC(B.X,"Lightweight and maneuverable, with high visibility offered by the canopy design, the Scarab is versatile and deadly, especially when equipped with weapon concealment systems.\n\nThe lack of rear weaponry leaves it vulnerable to attacks from behind, but it can be easily modified to add a mine dropper.\n\nThis is a great choice for beginners and experienced duellists alike.",23,"scarab")
B.jD=new A.bC(B.aR,"The tight-handling and devious Stiletto relies on speed and maneuverability to bolster its defense.\n\nIt wields huge shock weapons that inflict massive damage, but can be quite fragile.\n\nIts smokescreens create confusion in the battlefield and provide Stiletto with cover for strategic targeting or quick getaways.",29,"stiletto")
B.jE=new A.bC(B.X,"As the name implies, Slipstream is sleek, fast, and agile.\n\nWhile not heavily armored, it is particularly capable of mitigating tire damage.\n\nExcellent maneuverability and reliable slug weapons allow Slipstream to dart around the arena as it overwhelms the defensive weaknesses of any opponent.",27,"slipstream")
B.jF=new A.bC(B.aN,"Fuzion is quite maneuverable and outfitted with an autopilot system that keeps the driver focused while the gunner unleashes an assortment of rockets to send enemies careening out of control.\n\nWhile not heavily armored, it is sturdy enough to put up a good fight.",9,"fuzion")
B.jG=new A.bC(B.aS,"The Scimitar is an all-purpose design that can adapted to many different arena settings, from drifting on pavement to rock crawling.\n\nDurable, modular, and sporting respectable armor for most engagements, the Scimitar is a well-rounded workhorse that holds its own at any range, balancing large shock weapons, lasers, and tire-shredding weaponry.",24,"scimitar")
B.jH=new A.bC(B.X,"Packing an enormous punch into a compact and well-armored package, the Jackrabbit is particularly resilient in most duelling formats.\n\nOriginally designed using scrap parts, the Jackrabbit carries more diverse weaponry than many larger vehicles, and it can be fitted with significantly heavier plating than other vehicles of comparable size.\n\nThe Jackrabbit is most effective in close-quarters combat.",16,"jackrabbit")
B.jI=new A.bC(B.aS,"Well equipped and designed to hit extremely hard, the Joseph Special is an offensive powerhouse that demands an experienced crew.\n\nOpponents are advised to steer clear of the front arc, but nowhere is safe \u2014 watch for rocket attacks and mines when chasing behind it.",17,"josephSpecial")
B.jJ=new A.bC(B.aR,"A Jackal driver must be at once skittish, clever, and resourceful.\n\nThe small unibody design of the car makes it a small target, but only the front end carries any substantial plating.\n\nAs a result, Jackal performs best by charging directly at an opponent, attacking, then darting away before it gets into too much trouble.\n\nThe solid tires allow for high getaway speeds even after taking significant damage.",15,"jackal")
B.jK=new A.bC(B.X,"The Hammer has enough firepower to soften up opponents quite a bit before plowing through them for the finishing blow.\n\nIt trades heavy weapons for a thick outer hull, so it requires a patient crew to create an effective attack strategy.\n\nThe extra plating may hinder the handling a bit but a Hammer does not go down easily.",12,"hammer")
B.jL=new A.bC(B.aO,"Spark's design was heavily influenced by old stealth aircraft.\n\nIts front weapons are lethal, so don't get caught by surprise.\n\nUnfortunately, the front is also the most vulnerable spot to attack.\n\nHeavily armed and armored, Spark is a technological marvel that can easily accommodate live crew members or complex AI systems.",28,"spark")
B.jM=new A.bC(B.aN,"With excellent handling, a strengthened outer shell, and heavy firepower, the Shuriken is a frequent arena contender that strikes a careful balance between offense, defense, and driving performance.\n\nThis car has a complete lack of front weaponry, so an effective offense requires precision driving.",25,"shuriken")
B.jN=new A.bC(B.aO,"Lightly armored, but sprightly and fast, Redline is a tricky vehicle to master.\n\nThe front and back are quite dangerous, but the sides are somewhat exposed.\n\nRedline darts in and out of the fray, but it won't last long in close-quarter combat, as its armor was sacrificed in exchange for substantially improved handling.",21,"redline")
B.jO=new A.bC(B.aO,"Sledge is a titan on the battlefield, intimidating and mean.\n\nPart mobile weapons platform, part bulldozer, it unleashes a barrage of rockets and then fearlessly plunges into the thick of the smoke.\n\nSledge is built to deal a ton of damage quickly and then take its time picking apart the limping survivors.",26,"sledge")
B.jP=new A.bC(B.X,"The Boomerang's distinct profile is immediately recognizable.\n\nThe large rear tires seem like an obvious weak spot, but experienced duellists know to stay in the rear arc or risk an attack, even from great range.\n\nBoomerang is a favorite of many gunners as long as there is a talented driver at the controls.",4,"boomerang")
